9lRBewezZrL.jpg"",""genre_ids"":[28,18,53],""id"":2371,""original_language"":""ru"",""original_title"":""Тегеран-43"",""overview"":""This story starts in 1980 in Paris as the memories of Andrei Borodin, a Soviet agent, take the action back to 1943 during the Teheran meetings of Stalin, Roosevelt and Churchill. A high-ranking Nazi officer developed a plan to assassinate the three world leaders in order to undermine the Allied forces. He commissioned the German agent Max Richard to carry out his plan, but it failed miserably due to the quick action and thinking of Andrei. While in Teheran, Andrei met a French woman, Marie Louni, living in the city and they had a brief but intense affair. Nearly four decades later, the Nazi officer has been captured - but not for long. Freed by terrorists, the officer is hunting down the German agent who failed to carry out the planned assassinations. Max lives at Françoise, a young French woman, who hides him."",""popularity"":5.181,""poster_path"":""/cXrwys3cRpIttyKEvN0wGhqEMFA.jpg"",""release_date"":""1981-07-08"",""title"":""Teheran '43"",""video"":false,""vote_average"":6.2,""vote_count"":26},{""adult"":false,""backdrop_path"":""/2PuEmuXQF3XQZp8Ki2mGJXUGEOd.jpg"",""genre_ids"":[14,12,35,10751],""id"":2395,""original_language"":""fr"",""original_title"":""Astérix aux Jeux olympiques"",""overview"":""Astérix and Obélix have to win the Olympic Games in order to help their friend Alafolix marry Princess Irina. Brutus uses every trick in the book to have his own team win the game, and get rid of his father Julius Caesar in the process."",""popularity"":36.516,""poster_path"":""/eNB2SrqmTJLByRDq3akDzA6Z9rC.jpg"",""release_date"":""2008-01-30"",""title"":""Asterix at the Olympic Games"",""video"":false,""vote_average"":5.207,""vote_count"":1920},{""adult"":false,""backdrop_path"":null,""genre_ids"":[878,53],""id"":1034482,""original_language"":""en"",""original_title"":""Barbarella"",""overview"":""A remake of the 1968 classic, based on the comic books by Jean-Claude Forest. Barbarella, an astronaut from the 41st century, sets out to find and stop the evil scientist Durand Durand, whose Positronic Ray threatens to bring evil back into the galaxy."",""popularity"":13.769,""poster_path"":""/kOIVwpDSlLQxJzuBXQFvqdIEYjd.jpg"",""release_date"":"""",""title"":""Barbarella"",""video"":false,""vote_average"":0.0,""vote_count"":0},{""adult"":false,""backdrop_path"":""/greCbZG18ghhWBQuEIpIt8Z9hNt.jpg"",""genre_ids"":[28,18,9648,10752],""id"":394497,""original_language"":""ru"",""original_title"":""Бархатный сезон"",""overview"":""In the fall of 1938, three former fighters of the international brigade — russian Shukhov, frenchman Henri and american Liz — fall into a resort town on the border of Spain and France. Having met a nurse who is supposed to send Spanish children to Corsica, they decide to help her. However, a fascist rebellion suddenly breaks out in the city, and the children are held hostage to criminals."",""popularity"":1.821,""poster_path"":""/6iGaU1lJCUO6R7MCFHcbWDikdKe.jpg"",""release_date"":""1978-12-08"",""title"":""Velvet Season"",""video"":false,""vote_average"":0.0,""vote_count"":0}],""total_pages"":4023,""total_results"":80457},""translations"":{""translations"":[{""iso_3166_1"":""US"",""iso_639_1"":""en"",""name"":""English"",""english_name"":""English"",""data"":{""homepage"":""https://www.marvel.com/movies/captain-america-the-first-avenger"",""overview"":""During World War II, Steve Rogers is a sickly man from Brooklyn who's transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitler's ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination."",""runtime"":124,""tagline"":""When patriots become heroes"",""title"":""""}},{""iso_3166_1"":""RU"",""iso_639_1"":""ru"",""name"":""Pусский"",""english_name"":""Russian"",""data"":{""homepage"":"""",""overview"":""Стив Роджерс добровольно соглашается принять участие в эксперименте, который превратит его в суперсолдата, известного как Капитан Америка. Роджерс вступает в вооружённые силы США вместе с Баки Барнсом и Пегги Картер, чтобы бороться с враждебной организацией ГИДРА, которой управляет безжалостный Красный Череп."",""runtime"":119,""tagline"":""Когда патриоты становятся героями"",""title"":""Первый мститель""}},{""iso_3166_1"":""FR"",""iso_639_1"":""fr"",""name"":""Français"",""english_name"":""French"",""data"":{""homepage"":"""",""overview"":""1941, la Seconde Guerre Mondiale fait rage. Après avoir tenté vainement de s'engager dans l'armée pour se battre aux côtés des Alliés, Steve Rogers, frêle et timide, se porte volontaire pour participer à un programme expérimental qui va le transformer en un Super Soldat connu sous le nom de Captain America. Sous le commandement du colonel Chester Phillips, il s'apprête à affronter HYDRA, l'organisation scientifique secrète des nazis dirigée par le redoutable Crâne Rouge, aux côtés de Bucky Barnes et Peggy Carter..."",""runtime"":124,""tagline"":""Certains naissent héros, d'autres le deviennent."",""title"":""Captain America : First Avenger""}},{""iso_3166_1"":""DE"",""iso_639_1"":""de"",""name"":""Deutsch"",""english_name"":""German"",""data"":{""homepage"":"""",""overview"":""1942 – die USA ziehen in den Kampf gegen Hitler-Deutschland. Steve Rogers wird auf Grund seines Gesundheitszustands als ungeeignet eingestuft. Mit Hilfe des Project: Rebirth soll er trotzdem in den Kampf gegen Nazis ziehen. Der kränkliche Steve wird in eine Art Super-Soldaten namens Captain America transformiert. Hilfe bekommt der neue Superheld dabei von seinem Freund Bucky Barnes. Gemeinsam kämpfen sie gegen Red Skul, Hitlers Geheimwaffe im Krieg gegen den Rest der Welt."",""runtime"":124,""tagline"":""Wenn aus Patrioten Helden werden..."",""title"":""""}},{""iso_3166_1"":""PT"",""iso_639_1"":""pt"",""name"":""Português"",""english_name"":""Portuguese"",""data"":{""homepage"":"""",""overview"":""Após ser considerado inapto para o serviço militar, Steve Rogers voluntaria-se para um projeto de investigação altamente secreto que o transforma no Capitão América, um super-herói dedicado a defender os ideais da América e a liderar a luta pela liberdade como a derradeira arma contra o mal. Quando uma força assustadora ameaça toda a população mundial, o soldado mais grandioso do mundo combate a terrível organização HYDRA, liderada pelo vilão Caveira Vermelha."",""runtime"":124,""tagline"":"""",""title"":""Capitão América: O Primeiro Vingador""}},{""iso_3166_1"":""CZ"",""iso_639_1"":""cs"",""name"":""Český"",""english_name"":""Czech"",""data"":{""homepage"":"""",""overview"":""Steve Rogers je idealistický mladík, který stejně jako drtivá většina jeho vrstevníků touží vstoupit do armády, aby mohl pomoci zdolat nacisty, až se jeho země zapojí do Druhé světové války. Jenže nemá sebemenší šanci, protože je podměrečný a neduživý a jediným jeho předpokladem je zarputilost, s jakou se nechává opakovaně vyhazovat od odvodových komisí. Ta ve finále rozhodne o tom, že ho vyberou jako vhodného kandidáta pro vědecký experiment, který má produkovat Supervojáky. Jeho premiéra se vydaří a ze Stevea se díky vědeckému týmu vedeném Dr. Erskinem stane dokonalá lidská bytost. Na boj s nacisty přesto nedojde, protože se zjeví mnohem nebezpečnější nepřítel. Tajná organizace HYDRA, vedená všehoschopným gaunerem Johannem Schmidtem, totiž začala spřádat vlastní plány na ovládnutí světa. Steve Rogers dostane štít, který se stane jeho poznávacím znamením, skupinku schopných parťáků a vyrazí do mise, která mu může zajistit nesmrtelnost. Nebo přinést smrt."",""runtime"":125,""tagline"":""Stačí být vytrvalý a můžete se stát superhrdinou."",""title"":""Captain America: První Avenger""}},{""iso_3166_1"":""TR"",""iso_639_1"":""tr"",""name"":""Türkçe"",""english_name"":""Turkish"",""data"":{""homepage"":""https://www.marvel.com/movies/captain-america-the-first-avenger"",""overview"":""\""İlk Yenilmez: Kaptan Amerika\"" (2011), Marvel Sinematik Evreni'nin önemli yapı taşlarından biridir ve Steve Rogers'ın (Chris Evans) hikâyesini anlatır. Film, II. Dünya Savaşı döneminde geçer ve zayıf bir genç olan Steve'in kahramana dönüşümünü merkezine alır. Steve Rogers'ın askere katılma isteğiyle başlar; ancak fiziksel durumu nedeniyle sürekli reddedilir. Ancak, \""Yetenekli Asker\"" programına katılması için bir fırsat doğar. Dr. Abraham Erskine (Stanley Tucci) tarafından seçilen Steve, deneysel bir serum sayesinde süper insan güçlerine sahip olur. Bu süreçte, Kaptan Amerika kimliğiyle tanınmaya başlar. Steve, yeni gücünü kullanarak Nazi Almanyası'nın kötü liderlerinden biri olan Red Skull (Hugo Weaving) ile savaşmak zorundadır. Red Skull, Tesseract adı verilen mistik bir nesneye sahip olup, dünyayı ele geçirmeye çalışmaktadır. Kaptan Amerika, hem savaşta hem de dostlarıyla birlikte Red Skull'a karşı mücadele ederken, gerçek dostluğun ve fedakarlığın ne demek olduğunu öğrenir."",""runtime"":126,""tagline"":""Vatanseverler kahraman olduğunda"",""title"":""İlk Yenilmez: Kaptan Amerika""}},{""iso_3166_1"":""IT"",""iso_639_1"":""it"",""name"":""Italiano"",""english_name"":""Italian"",""data"":{""homepage"":"""",""overview"":""Il giovane Steve Rogers farebbe di tutto per arruolarsi: scioccato da ciò che i nazisti stanno facendo in Europa, non sopporta di starsene con le mani in mano. La sua costituzione fragile, l'asma, l'altezza tutt'altro che idonea, però, fanno sì che venga rispedito al mittente ad ogni tentativo. Finché un giorno, un uomo di stato, il dottor Abraham Erskine, s'interessa a lui e gli propone di sottoporsi alla sperimentazione di un siero che ne farà il primo super soldato dell'esercito a stelle e strisce. Rogers, dunque, subisce una straordinaria trasformazione, ma sarà solo dopo un passaggio per le fila dello show-business (e cioè solo dopo aver indossato una calzamaglia) a divenire davvero Captain America."",""runtime"":125,""tagline"":""Alcuni nascono eroi, altri lo diventano."",""title"":""Captain America - Il primo vendicatore""}},{""iso_3166_1"":""SE"",""iso_639_1"":""sv"",""name"":""svenska"",""english_name"":""Swedish"",""data"":{""homepage"":"""",""overview"":""Efter att ha blivit bedömd som olämplig för militärtjänst, anmäler sig Steve Rogers till ett topphemligt forskningsprojekt som förvandlar honom till supersoldaten Captain America. Därmed inleder han kampen mot den onda organisationen Hydra."",""runtime"":124,""tagline"":"""",""title"":""""}},{""iso_3166_1"":""NL"",""iso_639_1"":""nl"",""name"":""Nederlands"",""english_name"":""Dutch"",""data"":{""homepage"":"""",""overview"":""Een dappere, maar zachtaardige jonge soldaat genaamd Steve Rogers moet aan een aantal experimenten deelnemen voor het Amerikaanse leger, het zogenaamde Super Soldier programma. Maar wanneer het experiment wordt stopgezet besluiten ze Steve te gebruiken om het imago van het Amerikaanse leger te verbeteren."",""runtime"":124,""tagline"":""Waneer patriotten helden worden."",""title"":""""}},{""iso_3166_1"":""CN"",""iso_639_1"":""zh"",""name"":""普通话"",""english_name"":""Mandarin"",""data"":{""homepage"":"""",""overview"":""上世纪 40 年代，纳粹及其邪恶轴心的战火烧遍世界各个角落。居住在布鲁克林的小个子史蒂夫·罗杰斯（克里斯·埃文斯 Chris Evans 饰）心系国家，一心上阵杀敌，可是糟糕的体格让他始终被征兵办拒之门外。偶然的机会，在德籍科学家厄斯金博士（Stanley Tucci 饰）的帮助下，这个小个子男孩得以走入兵营，并接受了博士的试验，化身成为高大健壮、膂力过人的超级战士。与此同时，德国纳粹红骷髅部队的首领约翰·施密特（雨果·维文 Hugo Weaving 饰）依靠超自然的力量建立起一支超级战队，企图称霸全世界。为了营救好友，史蒂夫以美国队长的形象闯入施密特的军营，正邪两大超级战士的战斗就此展开……"",""runtime"":124,""tagline"":""钢铁侠系列原班制作班底"",""title"":""美国队长""}},{""iso_3166_1"":""PL"",""iso_639_1"":""pl"",""name"":""Polski"",""english_name"":""Polish"",""data"":{""homepage"":"""",""overview"":""Kapitan Ameryka to pierwsza postać stworzona przez Marvel Comics. Steve przed wojną był studentem sztuki, który w 1940 r. postanowił zaciągnąć się do wojska. Nie został przyjęty z powodu słabego zdrowia, ale dostał propozycję uczestniczenia w tajnym eksperymencie. Został poddany terapii, która zwiększyła jego inteligencję i siłę. Przemienił się w superbohatera nazwanego Kapitan Ameryka. Zostaje wysłany do walki z nazistami, a jego największym wrogiem jest Red Skull."",""runtime"":124,""tagline"":"""",""title"":""Kapitan Ameryka: Pierwsze starcie""}},{""iso_3166_1"":""HU"",""iso_639_1"":""hu"",""name"":""Magyar"",""english_name"":""Hungarian"",""data"":{""homepage"":"""",""overview"":""Javában dúl a második világháború amikor a lelkes és elszánt fiú, Steve Rogers jelentkezik a hadseregbe. Ám a gyenge fizikuma miatt kiszuperálják a sorozáson. Ezért örömmel jelentkezik az Újjászületés nevet viselő projektbe, melynek keretében szuperkatonát csinálnak belőle. Az átalakult Steve feladata megállítani a nácik titkos tudományos részlegét, a Hydrát, melyet a rettegett Vörös Koponya vezet."",""runtime"":125,""tagline"":""Amikor a hazafiak hősökké válnak."",""title"":""Amerika Kapitány: Az első bosszúálló""}},{""iso_3166_1"":""DK"",""iso_639_1"":""da"",""name"":""Dansk"",""english_name"":""Danish"",""data"":{""homepage"":"""",""overview"":""Den unge patriot Steve Rogers vil så gerne være med til at afklapse nazisterne under 2. verdenskrig. Men han er for svagelig til hæren. En venlig general tilbyder ham i stedet hovedrollen i et hemmeligt eksperiment. Rogers' krop bliver toptunet med serum og vita-stråler, og efter intens træning er han klar til at bekæmpe ondskab som supersoldaten Captain America."",""runtime"":124,""tagline"":"""",""title"":""""}},{""iso_3166_1"":""FI"",""iso_639_1"":""fi"",""name"":""suomi"",""english_name"":""Finnish"",""data"":{""homepage"":"""",""overview"":""Marvel-universumin sarjakuvasankari Captain America syntyi vuonna 1941 juuri sitä tarkoitusta varten, mitä nimestä ja vuosiluvusta voisi päätellä. Tähtilipun värejä ja muotoja suosiva Captain America on isänmaallinen sankari ja Hitlerin pahin vihollinen. Myös elokuvan tarina alkaa Yhdysvalloista toisen maailmansodan aikaan. Steve Rogers (Chris Evans) haluaa vapaaehtoisena sotimaan isänmaansa puolesta. Mutta hän ei kelpaa sotilaaksi, koska on sairaalloinen ruipelo. Armeijalle työskentelevä tiedemies järjestää lopulta Steven sotilaskoulutukseen, koska hän tarvitsee koekaniinin testeihinsä.Rogers osallistuu vapaaehtoisena armeijan salaiseen projektiin, joka muuttaa hänet huippusotilaaksi (Kapteeni Amerikka). Hän taistelee apurinsa Bucky Barnesin ja Peggy Carterin kanssa roistomaisen Red Skullin johtamaa pahaa HYDRA-organisaatiota vastaan."",""runtime"":0,""tagline"":"""",""title"":""""}},{""iso_3166_1"":""ES"",""iso_639_1"":""es"",""name"":""Español"",""english_name"":""Spanish"",""data"":{""homepage"":"""",""overview"":""Nacido durante la Gran Depresión, Steve Rogers creció como un chico enclenque en una familia pobre. Horrorizado por las noticias que llegaban de Europa sobre los nazis, decidió enrolarse en el ejército; sin embargo, debido a su precaria salud, fue rechazado una y otra vez. Enternecido por sus súplicas, el general Chester Phillips le ofrece la oportunidad de tomar parte en un experimento especial: la Operación Renacimiento. Tras meses de preparación y entrenamiento recibe su primera misión como Capitán América. Armado con un escudo indestructible y su inteligencia para la batalla, el Capitán América emprende la guerra contra el mal, como centinela de la libertad y como líder de los Vengadores."",""runtime"":124,""tagline"":""Cuando los patriotas se convierten en héroes."",""title"":""Capitán América: El primer vengador""}},{""iso_3166_1"":""IL"",""iso_639_1"":""he"",""name"":""עִבְרִית"",""english_name"":""Hebrew"",""data"":{""homepage"":"""",""overview"":""צעיר צנום וחלש אך אמיץ לב מצורף לניסוי סודי שנועד לייצר חייל-על. כשהניסוי מצליח והוא הופך לקפטן אמריקה, עליו לסכל משימה סודית של הנאצים."",""runtime"":0,""tagline"":""גיבור העל הראשון."",""title"":""קפטן אמריקה: גיבור העל הראשון""}},{""iso_3166_1"":""TH"",""iso_639_1"":""th"",""name"":""ภาษาไทย"",""english_name"":""Thai"",""data"":{""homepage"":"""",""overview"":""สตีฟ โรเจอร์ส เด็กชายขี้โรคที่เติบโตขึ้นมาในช่วงสภาวะเศรษฐกิจตกต่ำ ช่วงสงครามโลกครั้งที่ 2 ด้วยความที่มีฐานะยากจน และร่างกายที่อ่อนแอ ทำให้เขาต้องต่อสู้ชีวิตอย่างยากลำบาก และเมื่อสงครามโลกขยายขอบเขตมาถึงอเมริกาเขาสมัครเข้าเป็นทหาร เพื่อรับใช้ชาติ แต่เนื่องด้วยสภาพร่างกายที่อ่อนแอ เขาถูกปฏิเสฐจากทางกองทัพ แต่ความมุ่งมั่นของโรเจอร์ ไปเข้าตานายพลเชสเตอร์ ฟิลิปส์"",""runtime"":124,""tagline"":"""",""title"":""กัปตันอเมริกา: อเวนเจอร์ที่ 1""}},{""iso_3166_1"":""SK"",""iso_639_1"":""sk"",""name"":""Slovenčina"",""english_name"":""Slovak"",""data"":{""homepage"":"""",""overview"":""Steve Rogers je idealistický mladík, ktorý túži vstúpiť do armády, aby mohol Amerike pomôcť zdolať nacistov. Nemá ani najmenšiu šancu, pretože nemá miery, je neduživý a jediným jeho predpokladom je tvrdohlavosť, s akou sa necháva opakovane vyhadzovať od odvodových komisií. Tá vo finále rozhodne o tom, že ho vyberú ako vhodného kandidáta pre unikátny vedecký experiment, ktorý má produkovať Supervojakov. Vďaka vedeckému tímu sa stane dokonalá ľudská bytosť..."",""runtime"":125,""tagline"":"""",""title"":""Captain America: Prvý Avenger""}},{""iso_3166_1"":""JP"",""iso_639_1"":""ja"",""name"":""日本語"",""english_name"":""Japanese"",""data"":{""homepage"":""https://marvel.disney.co.jp/movie/captain-america1"",""overview"":""第二次世界大戦の最中、人一倍愛国心に燃えるスティーブ・ロジャースは兵士に志願し国の為に尽くしたかったが背も低く虚弱な体から兵士として認められず悶々としていた。ある日知り合った戦略科学予備軍の科学者であるエイブラハム・アースキン博士にその愛国心と強く正しい心を認められスーパーソルジャー計画の候補として実験被験者として選ばれ、超人血清を打たれスティーブは屈強なほぼ不死身の超人として生まれ変わる。"",""runtime"":124,""tagline"":""彼こそが、世界最初の英雄"",""title"":""キャプテン・アメリカ／ザ・ファースト・アベンジャー""}},{""iso_3166_1"":""GR"",""iso_639_1"":""el"",""name"":""ελληνικά"",""english_name"":""Greek"",""data"":{""homepage"":"""",""overview"":""Έτος 1941. Ένας ασθενικός στρατιώτης, ο Στιβ Ρότζερς, έπειτα από απανωτές απορρίψεις του από τον Αμερικανικό Στρατό, δέχεται να συμμετάσχει εθελοντικά σε ένα πιλοτικό, πειραματικό σχέδιο των Αμερικανικών Ενόπλων Δυνάμεων που στόχο έχει να δημιουργηθεί ένας Υπερ-Στρατιώτης. Όταν Ναζί κάνουν την εμφάνισή τους και απειλούν την υφιστάμενη τάξη πραγμάτων, ο Ρότζερς καλείται να αναλάβει το ρόλο του Captain America, του Πρώτου Εκδικητή και να σώσει τον κόσμο, έχοντας συνεργάτες του, τον παιδικό του φίλο Μπάκι Μπαρνς, την Πέγκι Κάρτερ και το Συνταγματάρχη Τσέστερ Φίλιπς, στον αγώνα του ενάντια στη σατανική οργάνωση HYDRA, της οποίας ηγείται ο Red Skull."",""runtime"":124,""tagline"":""Όταν οι πατριώτες γίνονται ήρωες."",""title"":""Ο Πρώτος Εκδικητής: Captain America""}},{""iso_3166_1"":""KR"",""iso_639_1"":""ko"",""name"":""한국어/조선말"",""english_name"":""Korean"",""data"":{""homepage"":"""",""overview"":""진주만 공습을 겪은 미국은 선전포고를 하고 제2차 세계대전에 발을 들인다. 스티브 로저스는 왜소하고 마른 체격으로 인해 입대마저 번번히 거부당하지만, 포기를 모르는 근성과 강한 희생 정신을 인정받아 최고의 전사를 양성하는 슈퍼 솔져 프로젝트에 스카우트된다. 비밀리에 진행된 실험을 통해 가장 완벽한 육체와 인간의 한계를 초월한 신체 능력을 얻게 된 스티브는 모두에게 캡틴으로 불리며 영웅으로 새롭게 태어난다. 하지만 거대한 히드라 조직을 앞세운 적의 공격은 한층 막강해지고, 그 핵심에 선 레드 스컬은 인류를 위협하는 최후의 전투를 준비하는데..."",""runtime"":123,""tagline"":""포기를 모르는 자, 최초의 슈퍼히어로로 깨어나다"",""title"":""캡틴 아메리카: 퍼스트 어벤져""}},{""iso_3166_1"":""RO"",""iso_639_1"":""ro"",""name"":""Română"",""english_name"":""Romanian"",""data"":{""homepage"":"""",""overview"":"""",""runtime"":124,""tagline"":"""",""title"":""Căpitanul America: Primul răzbunător""}},{""iso_3166_1"":""ID"",""iso_639_1"":""id"",""name"":""Bahasa indonesia"",""english_name"":""Indonesian"",""data"":{""homepage"":"""",""overview"":""Seorang pemuda sakit-sakitan yang berusaha untuk mendaftarkan diri di Angkatan Darat Amerika Serikat pada tahun 1943 untuk melawan Nazi, tetapi dianggap tidak layak secara fisik. Kemudian dia justru menawarkan diri untuk menjadi relawan dalam sebuah proyek yang disebut Rebirth, sebuah operasi militer rahasia untuk membantu upaya perang Amerika Serikat yang menggunakan serum tertentu untuk mengubah Steve Rogers ke puncak kesempurnaan manusia dan menjadi tentara super."",""runtime"":124,""tagline"":"""",""title"":""Kapten Amerika: Avenger Pertama""}},{""iso_3166_1"":""BR"",""iso_639_1"":""pt"",""name"":""Português"",""english_name"":""Portuguese"",""data"":{""homepage"":"""",""overview"":""Durante a Segunda Guerra Mundial, Steve Rogers é um homem doente, do Brooklyn, que se transforma no super soldado Capitão América para ajudar nos esforços de guerra. Rogers deve parar o Caveira Vermelha, o implacável chefe de armas de Adolf Hitler e líder de uma organização que pretende usar um misterioso mecanismo de incalculáveis poderes para dominar o mundo."",""runtime"":124,""tagline"":""Quando patriotas se tornam heróis!"",""title"":""Capitão América: O Primeiro Vingador""}},{""iso_3166_1"":""TW"",""iso_639_1"":""zh"",""name"":""普通话"",""english_name"":""Mandarin"",""data"":{""homepage"":"""",""overview"":""在第二次世界大戰，忠貞愛國的史蒂芬羅傑斯想要加入軍隊，幫助美國打敗納粹德國，可是他卻因為沒通過體檢而無法為國效命。就在一次因緣際會下，他參加了軍方的一個秘密實驗計畫...。史蒂芬接受改造後擁有了神力，之後他便身穿紅、白、藍三色戰鬥服為國家效力，成了人人尊稱的美國隊長。  美國隊長和其隊友在菲利普斯將軍（湯米李瓊斯飾）的領導下，向以紅骷髏（雨果威明飾）為首的納粹神秘恐怖組織九頭蛇軍團宣戰，一場正邪大戰就此展開！"",""runtime"":0,""tagline"":"""",""title"":""美國隊長""}},{""iso_3166_1"":""UA"",""iso_639_1"":""uk"",""name"":""Український"",""english_name"":""Ukrainian"",""data"":{""homepage"":"""",""overview"":""Під час Другої світової війни Стів Роджерс - хворобливий чоловік із Брукліна, який перетворився на супер-солдата Капітана Америку, щоб допомогти у військових діях. Роджерс повинен зупинити Червоного Черепа - нещадного лідера організації, яка має намір використовувати загадковий пристрій невідомої сили для світового панування."",""runtime"":0,""tagline"":""Коли патріоти стають героями."",""title"":""Перший месник""}},{""iso_3166_1"":""CA"",""iso_639_1"":""fr"",""name"":""Français"",""english_name"":""French"",""data"":{""homepage"":"""",""overview"":""En pleine Deuxième Guerre mondiale, Steve Rogers rêve de défendre son pays au front. Cependant, ses problèmes de santé et sa petite taille lui ferment les portes de l'armée. Il attire l'attention d'un scientifique qui a mis au point un traitement expérimental qui décuple ses capacités. Devenu un soldat d'élite à la force surhumaine, il devra déjouer les plans du nazi Johann Schmidt, ou Red Skull, qui prévoit dominer le monde grâce à une technologie héritée des dieux scandinaves. Mais si Captain America veut influencer l'issue de la guerre, il devra le faire contre les ordres de ses supérieurs, qui voient en lui un exercice de relation publique."",""runtime"":124,""tagline"":""Certains naissent héros, d'autres le deviennent."",""title"":""Capitaine America : Le premier vengeur""}},{""iso_3166_1"":""MX"",""iso_639_1"":""es"",""name"":""Español"",""english_name"":""Spanish"",""data"":{""homepage"":"""",""overview"":""Steve Rogers, un soldado militar rechazado, se transforma en el Capitán América después de tomar una dosis de un «suero de Súper-Soldado». Pero ser el Capitán América tiene un precio cuando intenta acabar con un belicista y una organización terrorista."",""runtime"":125,""tagline"":""Cuando los patriotas se convierten en héroes."",""title"":""Capitán América: El Primer Vengador""}},{""iso_3166_1"":""SI"",""iso_639_1"":""sl"",""name"":""Slovenščina"",""english_name"":""Slovenian"",""data"":{""homepage"":"""",""overview"":""Režiser filmov Volkodlak in Jurski park 3 predstavlja zgodbo o rojstvu legende, prvega maščevalca najbolj znanih stripovskih junakov. Steve je krmežljav mladenič, ki ga zavrnejo na naboru za vojsko, toda ker se želi boriti proti nacistom, sprejme ponudbo sodelovanja pri nenavadnem poskusu. S pomočjo nenavadnega sevanja prejme nadnaravne moči in se poda na nevarno misijo, ki ga popelje v osrčje spopadov in tik pred vrata pekla."",""runtime"":0,""tagline"":"""",""title"":""Stotnik Amerika: Prvi maščevalec""}},{""iso_3166_1"":""BG"",""iso_639_1"":""bg"",""name"":""български език"",""english_name"":""Bulgarian"",""data"":{""homepage"":"""",""overview"":""Смелият, все още кротък млад войник Стив Роджърс се записва като доброволец в серия от експерименти за програмата Супер Войник на американската армия. Военните успяват да го превърнат в човешко оръжие, но решават, че самата програма е прекалено скъпа, за да рискуват с обекта, като го вкарат в битка. Вместо това, решават да използват Стив като своя знаменитост и да парадират с него през Европа, за да повдига морала на американските войски, обличайки го в специален костюм."",""runtime"":0,""tagline"":""Когато патриотите стават герои"",""title"":""Капитан Америка: Първият отмъстител""}},{""iso_3166_1"":""HR"",""iso_639_1"":""hr"",""name"":""Hrvatski"",""english_name"":""Croatian"",""data"":{""homepage"":"""",""overview"":""Krajem Drugog svjetskog rata, Steve Rogers najviše od svega na svijetu želi postati vojnik. Jedini problem je u tome što ne može proći tjelesni test, kojeg je nekoliko puta pokušao proći pod različitim imenima. Dr. Abraham Erskine primjeti njegovu veliku ambicioznost te ga regrutira da bude dio posebnog vojnog eksperimenta. Rogers biva transformiran, kako mentalno tako i fizički, u super vojnika, a njegova misija postaje borba protiv nacističke organizacije Hydra i njenog vođe poznatog kao Crvena lubanja."",""runtime"":0,""tagline"":"""",""title"":""Kapetan Amerika: Prvi osvetnik""}},{""iso_3166_1"":""RS"",""iso_639_1"":""sr"",""name"":""Srpski"",""english_name"":""Serbian"",""data"":{""homepage"":"""",""overview"":""Крајем Другог светског рата, Стив Роџерс највише од свега на свету жели да постане војник. Једини проблем је у томе што не може да прође телесни тест који је неколико пута покушао да прође под различитим именима. Др. Абрахам Ерскин примећује његову велику амбициозност те га регрутује да буде део посебног војног експеримента. Роџерс бива трансформисан, како ментално, тако и физички, у супер војника, а његова мисија постаје борба против нацистичке организације, Хидра, и њеног вође познатог као Црвена лобања."",""runtime"":0,""tagline"":""Кад патриоте постану хероји."",""title"":""Капетан Америка: Први осветник""}},{""iso_3166_1"":""LV"",""iso_639_1"":""lv"",""name"":""Latviešu"",""english_name"":""Latvian"",""data"":{""homepage"":"""",""overview"":"""",""runtime"":0,""tagline"":"""",""title"":""Pirmais atriebējs""}},{""iso_3166_1"":""LT"",""iso_639_1"":""lt"",""name"":""Lietuvių"",""english_name"":""Lithuanian"",""data"":{""homepage"":"""",""overview"":""Styvas Roždersas (akt. Chris Evans) – silpnas mažylis, gimęs Didžiosios depresijos metais vargingoje ir nepasiturinčioje šeimoje. Antrojo pasaulinio karo metu vaikinas svajojo apie karinę tarnybą, deja, ir čia jam koją pakišo sveikata. Liesas, silpnos sveikatos Styvas pripažįstamas netinkamas karo tarnybai.  Nukabinusį nosį vaikiną užkalbina generolas Česteris Filipsas (akt. Tommy Lee Jones) ir pasiūlo savanoriškai dalyvauti moksliniame eksperimente. Bandymo metu paliegęs Styvo kūnas transformuojasi į raumeningą ir tvirtą, o pats vaikinukas tampa didvyriu – Kapitonu Amerika, apsiginklavusiu skydu ir ginančiu savo šalies piliečius."",""runtime"":0,""tagline"":"""",""title"":""Kapitonas Amerika: Pirmasis keršytojas""}},{""iso_3166_1"":""HK"",""iso_639_1"":""zh"",""name"":""普通话"",""english_name"":""Mandarin"",""data"":{""homepage"":"""",""overview"":""2012年，科學家在北極冰面上找到一架墜毀沉冰數十年的大型飛機，來到內部探查時發現一個被冰封住的藍紅星條的「盾牌」。回到1942年3月，二次大戰期間，挪威滕斯貝格遭受納粹科學秘密組織「九頭蛇」的大舉進攻，其首領約拿·施密特闖入一座教堂，尋獲一個封存多年的外星文物「宇宙魔方」，走前槍殺試圖警告他的修士後，摧毀整座村莊以實施滅口。"",""runtime"":124,""tagline"":"""",""title"":""美國隊長：復仇者先鋒""}},{""iso_3166_1"":""UZ"",""iso_639_1"":""uz"",""name"":""ozbek"",""english_name"":""Uzbek"",""data"":{""homepage"":"""",""overview"":"""",""runtime"":0,""tagline"":"""",""title"":""Kapitan Amerika: Birinchi Qasoskor""}},{""iso_3166_1"":""GE"",""iso_639_1"":""ka"",""name"":""ქართული"",""english_name"":""Georgian"",""data"":{""homepage"":"""",""overview"":""სტივ როჯერსს ჯარში წასვლაზე უთხრეს უარი. იგი მოხალისედ მიდის საიდუმლო მეცნიერული გამოკვლევების პროექტში. სწორედ აქ ხდება გმირი - კაპიტანი ამერიკა. მთავარმა გმირმა ამერიკის იდეალების დაცვას შესწირა თავი."",""runtime"":0,""tagline"":"""",""title"":""კაპიტანი ამერიკა: პირველი შურისმაძიებელი""}},{""iso_3166_1"":""VN"",""iso_639_1"":""vi"",""name"":""Tiếng Việt"",""english_name"":""Vietnamese"",""data"":{""homepage"":"""",""overview"":""Phim lấy bối cảnh từ đầu năm 1942, khi Mỹ đang tham gia Thế chiến thứ II và cần tới những chiến binh can trường. Chàng trai Steve Rogers (Chris Evans) là một người như vậy, nhưng thể hình quá thấp bé khiến anh không thể đạt được ước mơ tòng quân. Cơ may đến với Rogers khi anh được chọn tham gia một thí nghiệm của chính phủ, giúp biến người thường trở thành siêu chiến binh.  Mọi việc diễn ra suôn sẻ, biến Rogers thành một người cao to vạm vỡ, đầu óc tiếp thu mọi kỹ năng chiến đấu nhanh và vẫn giữ được trái tim nhân hậu. Anh trở thành Đội trưởng Mỹ, biểu tượng của nước Mỹ kể từ đó. Đối thủ của anh là phe Phát-xít, với quái nhân Red Skull, kẻ không chỉ quyền năng mà còn rất tàn ác."",""runtime"":0,""tagline"":""Khi nhà yêu nước trở thành anh hùng."",""title"":""Captain America: Kẻ Báo Thù Đầu Tiên""}},{""iso_3166_1"":""NO"",""iso_639_1"":""no"",""name"":""Norsk"",""english_name"":""Norwegian"",""data"":{""homepage"":"""",""overview"":""Captain America: The First Avenger tar for seg Marvel-universets startfase, hvor Steve Rogers melder seg som frivillig forsøkskanin til et eksperiment som forvandler ham til supersoldaten kjent som Captain America. Rogers slår seg sammen med Bucky Barnes  og Peggy Carter for å gå til krig mot den onde HYDRA-organisasjonen, ledet av superskurken Red Skull."",""runtime"":0,""tagline"":"""",""title"":""""}},{""iso_3166_1"":""IR"",""iso_639_1"":""fa"",""name"":""فارسی"",""english_name"":""Persian"",""data"":{""homepage"":"""",""overview"":""سال ۱۹۴۲. آمریکا به تازگی وارد جنگ جهانی دوم شده، و «استیو راجرز» (کریس ایوانز) که در امتحان ورودی ارتش قبول نشده است،‌ در کمال نا امیدی به سر می برد. اما وقتی که او برای یک پروژه سری داوطلب می شود، همه چیز تغییر می کند. او تحت یک آزمایش فوق سری قرار می گیرد، و ناگهان بدن ضعیف او به طرزی باورنکردنی قدرتمند می شود..."",""runtime"":0,""tagline"":"""",""title"":""کاپیتان آمریکا: نخستین انتقام‌جو""}},{""iso_3166_1"":""SA"",""iso_639_1"":""ar"",""name"":""العربية"",""english_name"":""Arabic"",""data"":{""homepage"":"""",""overview"":""عندما يصبح الوطنيون أبطالا\r خلال الحرب العالمية الثانية ، كان ستيف روجرز رجلا مريضا من بروكلين تحول إلى جندي خارق كابتن أمريكا للمساعدة في المجهود الحربي. يجب على روجرز إيقاف الجمجمة الحمراء - رأس أسلحة أدولف هتلر القاسي ، وزعيم منظمة تعتزم استخدام جهاز غامض من القوى التي لا توصف للسيطرة على العالم."",""runtime"":0,""tagline"":"""",""title"":""كابتن أمريكا: المنتقم الأول""}},{""iso_3166_1"":""ES"",""iso_639_1"":""ca"",""name"":""Català"",""english_name"":""Catalan"",""data"":{""homepage"":"""",""overview"":""Nascut durant la Gran Depressió, Steve Rogers va créixer com un noi escanyolida en una família pobra. Horroritzat per les notícies que arribaven d'Europa sobre els nazis, va decidir enrolar-se a l'exèrcit; no obstant això, a causa de la seva precària salut, va ser rebutjat una vegada i una altra. Enternit per les seves súpliques, el general Chester Phillips li ofereix l'oportunitat de prendre part en un experiment especial: l'operació Renaixement. Després de mesos de preparació i entrenament rep la seva primera missió com a Capità Amèrica. Armat amb un escut indestructible i la seva intel·ligència per a la batalla, el Capità Amèrica emprèn la guerra contra el mal, com a sentinella de la llibertat i com a líder dels Venjadors."",""runtime"":0,""tagline"":""Quan els patriotes es converteixen en herois."",""title"":""Capità Amèrica: El primer venjador""}}]},""external_ids"":{""imdb_id"":""tt0458339"",""wikidata_id"":""Q275120"",""facebook_id"":null,""instagram_id"":null,""twitter_id"":null},""videos"":{""results"":[{""iso_639_1"":""en"",""iso_3166_1"":""US"",""name"":""Featurette Clip 3"",""key"":""WQBHb6ZzQTg"",""site"":""YouTube"",""size"":1080,""type"":""Featurette"",""official"":true,""published_at"":""2011-10-28T14:55:13.000Z"",""id"":""64b84d9727db6100e2913c7b""},{""iso_639_1"":""en"",""iso_3166_1"":""US"",""name"":